public class str_51 {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int x = 1;
		while (x < 10) {
			x=x+1;
			if (x > 3) {
				System.out.println("Full X");
			}
		}

		int z = 5;
		while (z >1) {
			z=z-1;
			if (z < 3) {
				System.out.println("Small Z");
			}
		}
		int y =5;
		while (y>1) {
			y=y-1;
			if (y<3) {
				System.out.println("Small Y");
			}
		}
	}

}
